import React from 'react'
import Grid from "@material-ui/core/Grid";
import CompositionCard from "./CompositionCard";
import useStyles from "./Compositions.style";

function CompositionList({compositions = '', ...props}) {
    const classes = useStyles()
    const compositionNodes = compositions ?
        compositions.map(compInfo => <CompositionCard key={compInfo.id} info={compInfo}/>) :
        <div>Не найдено ни одной композиции...</div>

    return (
        <Grid container className={classes.root}>
            <Grid item xs={12}>
                <Grid container justify="center">
                    {compositionNodes}
                </Grid>
            </Grid>
        </Grid>
    );
}

export default CompositionList
